import React,{Component} from 'react';
import{
   CardTitle,
   Card,
   Button,
   Slider,
   Slide,
   MediaBox,
   Media,
   Row,
   Col
} from "react-materialize";

class App extends Component {
  render(){
    return (
      <div>

        <Slider
          fullscreen={false}
          options={{
            duration : 500,
            height : 300,
            indicators: true,
            interval:6000
          }}
        >
          <Slide>
          </Slide>
        </Slider>


      </div>
    );
  }
}

export default App;
